But, a few days later, there was a strong wind.The sea was rough and dangerous,and the ship went up and down, up and down. I was very ill, and very afraid.

&#39;Oh, I don&#39;t want to die!&#39;I cried. &#39;I want to live! If I live, I&#39;ll go home and never go to sea again!&#39;

The next day the wind dropped, and the sea was quiet and beautiful again.

â€˜Well, Bob,&#39;my friend laughed. &#39;How do you feel now?The wind wasn&#39;t too bad.&#39;

â€˜What!&#39;I cried. â€˜It was a terrible storm.&#39;

â€˜Oh, that wasn&#39;t a storm,&#39;my friend answered.â€˜Just a lit- tle wind. Forget it. Come and have a drink.&#39;

After a few drinks with my friend , I felt better. I forgot about the danger and decided not to go home. I didn&#39;t want my friends and family to laugh at me!

I stayed in London for some time, but I still wanted to go to sea. So, when the captain of a ship asked me to go with him to Guinea in Africa, I agreed. And so I went to sea for the second time.

It was a good ship and everything went well at first, but I was very ill again. Then, when we were near the Canary Islands, a Turkish pirate ship came after us. They were famous
thieves of the sea at that time. There was a long, hard fight, but when it finished, we and the ship were prisoners.

The Turkish captain and his men took us to Sallee in Morocco. They wanted to sell us as slaves in the markets there. But inthe end the Turkish captain decided to keep me for himself, and took me home with him. This was a sudden and terrible change in my life. I was now a slave and this Turkish captain was my master.

